\"data\";s:463:\"WordPress 4.9.7 jest ju≈º dostƒôpny. To wydanie poprawia bezpiecze≈Ñstwo¬†wszystkich wersji systemu poczƒÖwszy od 3.7. Zalecane jest natychmiastowe przeprowadzenie aktualizacji. WordPress w wersji 4.9.6 i wcze≈õniejszych zawiera b≈ÇƒÖd zwiƒÖzany z obs≈ÇugƒÖ medi√≥w, kt√≥ry mo≈ºe pozwoliƒá u≈ºytkownikom z pewnymi prawami dostƒôpu na podjƒôcie pr√≥by usuniƒôcia plik√≥w spoza katalogu uploads. Dziƒôkujemy Slavco za zg≈Çoszenie b≈Çƒôdu, a tak≈ºe Mattowi [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"Chris Trynkiewicz (Sukces Strony)\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:4564:\"<p>WordPress 4.9.7 jest ju≈º dostƒôpny. <strong>To wydanie poprawia bezpiecze≈Ñstwo</strong>¬†wszystkich wersji systemu poczƒÖwszy od 3.7. Zalecane jest natychmiastowe przeprowadzenie aktualizacji.</p>\n<p><span id=\"more-1945\"></span></p>\n<p>WordPress w wersji 4.9.6 i wcze≈õniejszych zawiera b≈ÇƒÖd zwiƒÖzany z obs≈ÇugƒÖ medi√≥w, kt√≥ry mo≈ºe pozwoliƒá u≈ºytkownikom z pewnymi prawami dostƒôpu na podjƒôcie pr√≥by usuniƒôcia plik√≥w spoza katalogu <em>uploads</em>.</p>\n<p>Dziƒôkujemy <a href=\"https://hackerone.com/slavco\">Slavco</a> za zg≈Çoszenie b≈Çƒôdu, a tak≈ºe <a href=\"https://www.wordfence.com/\">Mattowi Barry&#8217;emu</a> za zg≈Çoszenie powiƒÖzanych z tƒÖ kwestiƒÖ problem√≥w.</p>\n<p>W WordPressie 4.9.7 naprawiono tak≈ºe 17 innych problem√≥w, w szczeg√≥lno≈õci:</p>\n<ul>\n<li>Taksonomie: Ulepszenie obs≈Çugi cache dla zapyta≈Ñ dotyczƒÖcych termin√≥w.</li>\n<li>Wpisy i inne Typy Tre≈õci: Usuwanie ciasteczka dotyczƒÖcego has≈Ça dla podstrony, gdy u≈ºytkownik wyloguje siƒô.</li>\n<li>Widgety: Dopuszczenie u≈ºywania podstawowych znacznik√≥w HTML w opisach paneli bocznych w sekcji Widgety panelu administracyjnego.</li>\n<li>Kokpit wydarze≈Ñ spo≈Çeczno≈õciowych: Zawsze pokazuj najbli≈ºsze spotkanie WordCamp, je≈õli takowe siƒô zbli≈ºa &#8211; nawet, gdy wcze≈õniej planowane sƒÖ spotkania w dalszych lokalizacjach.</li>\n<li>Prywatno≈õƒá: Upewnienie siƒô, ≈ºe domy≈õlna tre≈õƒá polityki prywatno≈õci nie spowoduje wystƒÖpienia krytycznego b≈Çƒôdu podczas czyszczenia regu≈Ç przekszta≈Çcania adres√≥w poza kontekstem administracyjnym.</li>\n</ul>\n<p>W dokumentacji Codex znajdziesz <a href=\"https://codex.wordpress.org/Version_4.9.7\">wiƒôcej informacji na temat wszystkich kwestii rozwiƒÖzanych w wersji 4.9.7</a>.</p>\n<p><a href=\"https://pl.wordpress.org/\">Pobierz WordPressa 4.9.7</a>¬†lub udaj siƒô do sekcji Kokpit ‚Üí Aktualizacje panelu administracyjnego i po prostu kliknij przycisk ‚ÄûZaktualizuj teraz‚Äù. Witryny, kt√≥re obs≈ÇugujƒÖ automatyczne aktualizacje, rozpoczƒô≈Çy ju≈º ich przeprowadzanie.</p>\n<p>Wcze≈õniej zaplanowane wydanie 4.9.7 bƒôdzie od teraz nazywane 4.9.8 i zostanie <a href=\"https://make.wordpress.org/core/2018/07/04/dev-chat-summary-july-4th-4-9-7-week-7/\">opublikowane zgodnie z planem</a>.</p>\n<p>Dziƒôkujemy wszystkim, kt√≥rzy przyczynili siƒô do powstania wersji 4.9.7:</p>\n<p><a href=\"https://profiles.wordpress.org/1naveengiri/\">1naveengiri</a>, <a href=\"https://profiles.wordpress.org/jorbin/\">Aaron Jorbin</a>, <a href=\"https://profiles.wordpress.org/abdullahramzan/\">abdullahramzan</a>, <a href=\"https://profiles.wordpress.org/alejandroxlopez/\">alejandroxlopez</a>, <a href=\"https://profiles.wordpress.org/azaozz/\">Andrew Ozz</a>, <a href=\"https://profiles.wordpress.org/aryamaaru/\">Arun</a>, <a href=\"https://profiles.wordpress.org/birgire/\">Birgir Erlendsson (birgire)</a>, <a href=\"https://profiles.wordpress.org/bjornw/\">BjornW</a>, <a href=\"https://profiles.wordpress.org/boonebgorges/\">Boone Gorges</a>, <a href=\"https://profiles.wordpress.org/kraftbj/\">Brandon Kraft</a>, <a href=\"https://profiles.wordpress.org/chetan200891/\">Chetan Prajapati</a>, <a href=\"https://profiles.wordpress.org/dlh/\">David Herrera</a>, <a href=\"https://profiles.wordpress.org/flixos90/\">Felix Arntz</a>, <a href=\"https://profiles.wordpress.org/garetharnold/\">Gareth</a>, <a href=\"https://profiles.wordpress.org/iandunn/\">Ian Dunn</a>, <a href=\"https://profiles.wordpress.org/ianbelanger/\">ibelanger</a>, <a href=\"https://profiles.wordpress.org/johnbillion/\">John Blackbourn</a>, <a href=\"https://profiles.wordpress.org/desrosj/\">Jonathan Desrosiers</a>, <a href=\"https://profiles.wordpress.org/joyously/\">Joy</a>, <a href=\"https://profiles.wordpress.org/khaihong/\">khaihong</a>, <a href=\"https://profiles.wordpress.org/lbenicio/\">lbenicio</a>, <a href=\"https://profiles.wordpress.org/leanderiversen/\">Leander Iversen</a>, <a href=\"https://profiles.wordpress.org/mermel/\">mermel</a>, <a href=\"https://profiles.wordpress.org/metalandcoffee/\">metalandcoffee</a>, <a href=\"https://profiles.wordpress.org/jbpaul17/\">Migrated to @jeffpaul</a>, <a href=\"https://profiles.wordpress.org/palmiak/\">palmiak</a>, <a href=\"https://profiles.wordpress.org/sergeybiryukov/\">Sergey Biryukov</a>, <a href=\"https://profiles.wordpress.org/skoldin/\">skoldin</a>, <a href=\"https://profiles.wordpress.org/subrataemfluence/\">Subrata Sarkar</a>, <a href=\"https://profiles.wordpress.org/itowhid06/\">Towhidul Islam</a>, <a href=\"https://profiles.wordpress.org/warmlaundry/\">warmlaundry</a> oraz <a href=\"https://profiles.wordpress.org/yuriv/\">YuriV</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:101:\"https://pl.wordpress.org/2018/07/07/wordpress-4-9-7-wydanie-poprawiajace-bezpieczenstwo-i-bledy/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8: