kniƒôcia kod SQL (SQLi). Core WordPressa nie jest bezpo≈õrednio nara≈ºony na ten problem, ale poprawiono [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Marcin Pietrzak\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3051:\"<p>WordPress 4.8.2 jest ju≈º dostƒôpny. Wersja <strong>poprawia bezpiecze≈Ñstwo</strong> wszystkich poprzednich wersji i zdecydowanie zachƒôcamy do natychmiastowej aktualizacji witryn.</p>\n<p>WordPress w wersji 4.8.1 i starsze majƒÖ nastƒôpujƒÖce problemy z bezpiecze≈Ñstwem:</p>\n<ol>\n<li><strong>$wpdb-&gt; prepare()</strong> mog≈Ço tworzyƒá nieoczekiwane i niebezpieczne zapytania prowadzƒÖce do potencjalnego wstrzykniƒôcia kod SQL (SQLi). Core WordPressa nie jest bezpo≈õrednio nara≈ºony na ten problem, ale poprawiono proces tworzenia zapyta≈Ñ aby zapobiegaƒá podatno≈õci we wtyczkach i motywach. Zg≈Çoszone przez <a href=\"https://hackerone.com/slavco\">Slavco</a></li>\n<li>Wykryto podatno≈õƒá na cross-site scripting (XSS) w u≈ºywaniu oEmbed. Zg≈Çoszone przez xknown zespo≈Çu ds. Zabezpiecze≈Ñ WordPress.</li>\n<li>W edytorze wizualnym wykryto lukƒô w zabezpieczeniach skrypt√≥w przed cross-site scripting (XSS) Zg≈Çoszone przez¬†<a href=\"https://twitter.com/brutelogic\">Rodolfo Assis (@brutelogic)</a> Sucuri Security.</li>\n<li>W kodzie do rozpakowywania wykryto lukƒô w zabezpieczeniach ≈õcie≈ºki do pliku. Zg≈Çoszone przez <a href=\"https://hackerone.com/noxrnet\">Alex Chapman (noxrnet)</a>.</li>\n<li>W edytorze wtyczek wykryto luka w zabezpieczeniach cross-site scripting¬†(XSS). Zg≈Çoszone przez ÈôàÁëûÁê¶ (Chen Ruiqi).</li>\n<li>Na ekranie u≈ºytkownika i terminach edycji zosta≈Çy wykryte otwarte przekierowanie. Zg≈Çoszone przez <a href=\"https://hackerone.com/ysx\">Yasin Soliman (ysx)</a>.</li>\n<li>Odkryto lukƒô w zabezpieczeniach ≈õcie≈ºki na ekranie personalizacji witryny. Zg≈Çoszone przez Weston Ruter z zespo≈Çu ds. Bezpiecze≈Ñstwa WordPress.</li>\n<li>Wykryto podatno≈õƒá na cross-site scripting (XSS) ¬†w nazwach szablon√≥w. Zg≈Çoszone przez <a href=\"https://hackerone.com/sikic\">Luka (sikic)</a>.</li>\n<li>Wykryto podatno≈õƒá na cross-site scripting (XSS) w linkach modalnych. Zg≈Çoszone przez <a href=\"https://hackerone.com/qasuar\">Anas Roubi (qasuar)</a>.</li>\n</ol>\n<p>Dziƒôkujemy zg≈ÇaszajƒÖcym za praktykowanie <a href=\"https://make.wordpress.org/core/handbook/testing/reporting-security-vulnerabilities/\">odpowiedzialnego ujawnienia (en)</a>.</p>\n<p>Opr√≥cz powy≈ºszych kwestii zwiƒÖzanych z bezpiecze≈Ñstwem, WordPress 4.8.2 zawiera 6 poprawek utrzymaniowych serii 4.8. Wiƒôcej informacji mo≈ºna znale≈∫ƒá w <a href=\"https://codex.wordpress.org/Version_4.8.2\">notce wydania wersji (en)</a> oraz na <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;milestone=4.8.2&amp;group=component&amp;col=id&amp;col=summary&amp;col=component&amp;col=status&amp;col=owner&amp;col=type&amp;col=priority&amp;col=keywords&amp;order=priority\">li≈õcie zmian</a>.</p>\n<p><a href=\"https://pl.wordpress.org/wordpress-4.8.2-pl_PL.zip\">Pobierz WordPress 4.8.2</a> lub przejd≈∫ do Panel ‚Üí Aktualizacje i kliknij przycisk &#8222;Aktualizuj teraz&#8221;. Strony obs≈ÇugujƒÖce automatyczne aktualizacje w tle ju≈º zaczynajƒÖ aktualizowaƒá siƒô do wersji 4.8.2.</p>\n<p>Dziƒôkujemy wszystkim, kt√≥rzy przyczynili siƒô do wydania 4.8.2.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:101:\"https://pl.wordpress.org/2017/09/22/wordpress-4-8-2-wydanie-poprawiajace-bezpieczenstwo-i-bledy/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base