ƒá z was ju≈º wie, ≈ºe w zesz≈Çym tygodniu opublikowali≈õmy program tegorocznego WordCampa, kt√≥ry odbƒôdzie siƒô w dniach 6-8 lipca w Poznaniu. WordCamp Pozna≈Ñ 2018 zbli≈ºa siƒô du≈ºymi krokami! Je≈õli nie masz jeszcze biletu, to nie zastanawiaj siƒô ju≈º d≈Çu≈ºej, tylko kup bilet na najwa≈ºniejsze WordPressowe wydarzenie 2018 roku! Zapraszamy do zapoznania siƒô z [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:18:\"Katarzyna Gajewska\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:2455:\"<p>Pewnie wiƒôkszo≈õƒá z was ju≈º wie, ≈ºe w zesz≈Çym tygodniu opublikowali≈õmy program tegorocznego WordCampa, kt√≥ry odbƒôdzie siƒô w dniach <strong>6-8 lipca w Poznaniu</strong>.</p>\n<p>WordCamp Pozna≈Ñ 2018 zbli≈ºa siƒô du≈ºymi krokami! Je≈õli nie masz jeszcze biletu, to nie zastanawiaj siƒô ju≈º d≈Çu≈ºej, tylko <a href=\"https://2018.poznan.wordcamp.org/bilety/\" target=\"_blank\" rel=\"noopener noreferrer\"><strong>kup bilet</strong></a> na najwa≈ºniejsze WordPressowe wydarzenie 2018 roku! Zapraszamy do zapoznania siƒô z <a href=\"https://2018.poznan.wordcamp.org/program/\" target=\"_blank\" rel=\"noopener noreferrer\"><strong>pe≈Çnym programem konferencji</strong></a> i do zapisywania siƒô na warsztaty oraz Contributor Day.</p>\n<p>Startujemy 6 lipca! Pierwszego dnia konferencji po prostu nie mo≈ºna przegapiƒá. Zaczniemy od bardziej praktycznych wyzwa≈Ñ. Ka≈ºdy uczestnik bƒôdzie mia≈Ç mo≈ºliwo≈õƒá wziƒôcia udzia≈Çu w ciekawych warsztatach, kt√≥re bƒôdƒÖ ≈õwietnƒÖ okazjƒÖ, aby zdobyƒá nowe umiejƒôtno≈õci i poznaƒá ciekawych ludzi. W tym roku zaserwujemy a≈º 6 r√≥≈ºnych warsztat√≥w. Warto zapoznaƒá siƒô z tematami i ju≈º dzi≈õ zarezerwowaƒá sobie miejsce. R√≥wnolegle do warsztat√≥w bƒôdzie odbywa≈Ç siƒô <a href=\"https://2018.poznan.wordcamp.org/czym-jest-contributor-day/\" target=\"_blank\" rel=\"noopener noreferrer\"><strong>Contributor Day</strong></a>, podczas kt√≥rego bƒôdzie mo≈ºna do≈ÇƒÖczyƒá do innych entuzjast√≥w i popracowaƒá nad kodem, t≈Çumaczeniem lub zajƒÖƒá siƒô odpowiadaniem na pytania na forum wsparcia. Z pewno≈õciƒÖ ka≈ºdy znajdzie tutaj co≈õ dla siebie!</p>\n<p>Kolejne dwa dni konferencji bƒôdƒÖ wype≈Çnione ciekawymi prelekcjami, na kt√≥rych nie mo≈ºe ciƒô zabraknƒÖƒá! Tematy sƒÖ podzielone na dwie ≈õcie≈ºki: og√≥lnƒÖ i technicznƒÖ. ≈öcie≈ºkƒô og√≥lnƒÖ polecamy wszystkim, kt√≥rzy sƒÖ zainteresowani tematami zwiƒÖzanymi z wykorzystaniem WordPressa, blogowaniem i innymi zagadnieniami. Bƒôdziecie mieli okazjƒô dowiedzieƒá siƒô wiƒôcej o dostƒôpno≈õci, pracy zdalnej, wycenie projekt√≥w czy analityce. Z kolei ≈õcie≈ºkƒô technicznƒÖ polecamy uczestnikom poszukujƒÖcym bardziej specjalistycznej wiedzy. Bƒôdzie to ≈õwietna okazja, ≈ºeby pos≈Çuchaƒá prelekcji na temat backupu, automatyzacji zada≈Ñ czy zabezpieczenia WordPressa. Tematyka zar√≥wno ≈õcie≈ºki og√≥lnej, jak i technicznej, jest bardzo zr√≥≈ºnicowana. Bez wƒÖtpienia ka≈ºdy znajdzie co≈õ, co go zainteresuje!</p>\n<p>Do zobaczenia w Poznaniu!</p>\n<p>&nbsp;</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:82:\"https://pl.wordpress.org/2018/05/26/program-wordcamp-poznan-2018-juz-tu-jest/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"3\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n			