dziƒôki czemu strony sta≈Çy [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"Chris Trynkiewicz (Sukces Strony)\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:2631:\"<p>WordPress 4.9.4 jest ju≈º dostƒôpny.</p>\n<p>To wydanie rozwiƒÖzuje istotny problem wprowadzony w wersji 4.9.3, kt√≥ry powodowa≈Ç, ≈ºe strony obs≈ÇugujƒÖce automatyczne aktualizacje nie bƒôdƒÖ mog≈Çy ich przeprowadziƒá. <strong><span style=\"text-decoration: underline\">Wymagane jest rƒôczne zaktualizowanie WordPressa</span> do wersji 4.9.4 przez Ciebie lub Twojego dostawcƒô hostingu.</strong></p>\n<p><span id=\"more-1539\"></span></p>\n<p>Cztery lata temu, w wydaniu¬†<a href=\"https://wordpress.org/news/2013/10/basie/\">3.7 &#8222;Basie&#8221; WordPressa</a>¬†wprowadzili≈õmy mo≈ºliwo≈õƒá automatycznej aktualizacji systemu, dziƒôki czemu strony sta≈Çy siƒô bezpieczniejsze i mniej awaryjne &#8211; nawet, je≈õli samodzielnie nie mia≈Çe≈õ mo≈ºliwo≈õci ich aktualizowaƒá. Przez te 4 lata mechanizm ten pom√≥g≈Ç milionom witryn, aktualizujƒÖc je do bie≈ºƒÖcych wersji i naprawiajƒÖc bardzo sporadyczne usterki. Niestety we wczorajszym <a href=\"https://pl.wordpress.org/2018/02/06/wordpress-4-9-3-wydanie-poprawiajace-bledy/\">wydaniu 4.9.3</a>¬†znalaz≈Ç siƒô wa≈ºny b≈ÇƒÖd, kt√≥ry zosta≈Ç wykryty dopiero po upublicznieniu nowej wersji systemu. B≈ÇƒÖd ten powoduje, ≈ºe WordPress nie zaktualizuje siƒô automatycznie do wersji 4.9.4, co oznacza, ≈ºe aktualizacjƒô takƒÖ trzeba przeprowadziƒá rƒôcznie z poziomu panelu administracyjnego lub z pomocƒÖ dostawcy serwera hostingowego.</p>\n<p><strong>Aby przeprowadziƒá rƒôcznƒÖ aktualizacjƒô,¬†udaj siƒô do sekcji Kokpit ‚Üí Aktualizacje panelu administracyjnego i po prostu kliknij przycisk ‚ÄûZaktualizuj teraz‚Äù. Dop√≥ki tego nie wykonasz, WordPress¬†<span style=\"text-decoration: underline\">nie bƒôdzie aktualizowa≈Ç siƒô automatycznie do kolejnych wersji</span>. Zalecamy, by zrobiƒá to natychmiast.</strong></p>\n<p>Dostawcy hostingu, kt√≥rzy aktualizujƒÖ automatycznie WordPressa w imieniu swoich klient√≥w, mogƒÖ przystƒÖpiƒá do aktualizacji w standardowym trybie. Bƒôdziemy ≈õci≈õle wsp√≥≈Çpracowaƒá z innymi dostawcami hostingu, by jak najwiƒôcej ich klient√≥w otrzyma≈Ço tƒÖ aktualizacjƒô.</p>\n<p><a href=\"https://make.wordpress.org/core/2018/02/06/wordpress-4-9-4-release-the-technical-details/\">Wiƒôcej szczeg√≥≈Ç√≥w technicznych opublikowali≈õmy na naszym blogu o tworzeniu rdzenia WordPressa</a>. Pe≈Çna lista zmian dostƒôpna jest w <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;milestone=4.9.4&amp;group=component\">spisie zamkniƒôtych wƒÖtk√≥w</a>.</p>\n<p><a href=\"https://pl.wordpress.org/\">Pobierz WordPressa 4.9.4</a>¬†lub udaj siƒô do sekcji Kokpit ‚Üí Aktualizacje panelu administracyjnego i po prostu kliknij przycisk ‚ÄûZaktualizuj teraz‚Äù.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:89:\"https://pl.wordpress.org/2018/02/06/wordpress-4-9-4-wydanie-poprawiajace-wazny-blad/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"7\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\