(2, 1, '2020-01-18 12:04:57', '2020-01-18 11:04:57', '<!-- wp:paragraph -->\n<p>To jest przyk≈Çadowa strona. Strony sƒÖ inne ni≈º wpisy na blogu, poniewa≈º nie tylko znajdujƒÖ siƒô zawsze w jednym miejscu, ale tak≈ºe pojawiajƒÖ siƒô w menu witryny (w wiƒôkszo≈õci motyw√≥w). Wiƒôkszo≈õƒá u≈ºytkownik√≥w zaczyna od strony z informacjami o sobie, kt√≥ra zapozna ich przed odwiedzajƒÖcymi witrynƒô. Taka strona mo≈ºe zawieraƒá na przyk≈Çad taki tekst:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Cze≈õƒá! Za dnia jestem kurierem rowerowym, nocƒÖ pr√≥bujƒô swoich si≈Ç w aktorstwie, a to jest moja witryna. Mieszkam w Krakowie, mam wspania≈Çego psa kt√≥ry wabi siƒô Reks i lubiƒô pi√±a coladƒô (oraz spacery, gdy pada deszcz).</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...albo co≈õ takiego:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Firma XYZ Doohickey zosta≈Ça za≈Ço≈ºona w 1971 roku i od tamtej pory dostarcza spo≈Çecze≈Ñstwu dobrej jako≈õci gad≈ºety. ZnajdujƒÖca siƒô w Gotham City XYZ zatrudnia ponad 2000 os√≥b i robi niesamowite rzeczy dla spo≈Çeczno≈õci Gotham.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>Jako nowy u≈ºytkownik WordPressa, powiniene≈õ przej≈õƒá do <a href=\"http://localhost/burgers_workon_project/wp-admin/\">swojego kokpitu</a> aby usunƒÖƒá tƒô stronƒô i stworzyƒá nowe z w≈ÇasnƒÖ tre≈õciƒÖ. Dobrej zabawy!</p>\n<!-- /wp:paragraph -->', 'Przyk≈Çadowa strona', '', 'trash', 'closed', 'open', '', 'przykladowa-strona__trashed', '', '', '2020-01-20 12:18:58', '2020-01-20 11:18:58', '', 0, 'http://localhost/burgers_workon_project/?page_id=2', 0, 'page', '', 0),
(3, 1, '2020-01-18 12:04:57', '2020-01-18 11:04:57', '<!-- wp:heading --><h2>Kim jeste≈õmy</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Adres naszej strony internetowej to: http://localhost/burgers_workon_project.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Jakie dane osobiste zbieramy i dlaczego je zbieramy</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Komentarze</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Kiedy odwiedzajƒÖcy witrynƒô zostawia komentarz, zbieramy dane widoczne w formularzu komentowania, jak i adres IP odwiedzajƒÖcego oraz podpis jego przeglƒÖdarki jako pomoc przy wykrywaniu spamu.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Zanonimizowany ciƒÖg znak√≥w stworzony na podstawie twojego adresu email (tak zwany hash) mo≈ºe zostaƒá przes≈Çany do us≈Çugi Gravatar w celu sprawdzenia czy jej u≈ºywasz. Polityka prywatno≈õci us≈Çugi Gravatar jest dostƒôpna tutaj: https://automattic.com/privacy/. Po zatwierdzeniu komentarza tw√≥j obrazek profilowy jest widoczny publicznie w kontek≈õcie twojego komentarza.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Media</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Je≈õli jeste≈õ zarejestrowanym u≈ºytkownikiem i wgrywasz na witrynƒô obrazki, powiniene≈õ unikaƒá przesy≈Çania obrazk√≥w z tagami EXIF lokalizacji. OdwiedzajƒÖcy stronƒô mogƒÖ pobraƒá i odczytaƒá pe≈Çne dane lokalizacyjne z obrazk√≥w w witrynie.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Formularze kontaktowe</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Ciasteczka</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Je≈õli zostawisz na naszej witrynie komentarz, bƒôdziesz m√≥g≈Ç wybraƒá opcjƒô zapisu twojej nazwy, adresu email i adresu strony internetowej w ciasteczkach, dziƒôki kt√≥rym podczas pisania kolejnych komentarzy powy≈ºsze informacje bƒôdƒÖ ju≈º dogodnie uzupe≈Çnione. Te ciasteczka wygasajƒÖ po roku.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Je≈õli odwiedzisz stronƒô logowania, utworzymy tymczasowe ciasteczko na potrzeby sprawdzenia czy twoja przeglƒÖdarka akceptuje ciasteczka. To ciasteczko nie zawiera ≈ºadnych danych osobistych i zostanie wyrzucone, kiedy zamkniesz przeglƒÖdarkƒô.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Podczas logowania tworzymy dodatkowo kilka ciasteczek potrzebnych do zapisu twoich informacji logowania oraz wybranych opcji ekranu. Ciasteczka logowania wygasajƒÖ po dw√≥ch dniach, a opcji ekranu po roku. Je≈õli zaznaczysz opcjƒô &bdquo;Pamiƒôtaj mnie&rdquo;, logowanie wyga≈õnie po dw√≥ch tygodniach. Je≈õli wylogujesz siƒô ze swojego konta, ciasteczka logowania zostanƒÖ usuniƒôte.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Je≈õli zmodyfikujesz albo opublikujesz artyku≈Ç, w twojej przeglƒÖdarce zostanie zapisane dodatkowe ciasteczko. To ciasteczko nie zawiera ≈ºadnych danych osobistych, wskazujƒÖc po prostu na identyfikator przed chwilƒÖ edytowanego artyku≈Çu. Wygasa ono po 1 dniu.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Osadzone tre≈õci z innych witryn</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Artyku≈Çy na tej witrynie mogƒÖ zawieraƒá osadzone tre≈õci (np. filmy, obrazki, artyku≈Çy itp.). Osadzone tre≈õci z innych witryn zachowujƒÖ siƒô analogicznie do tego, jakby u≈ºytkownik odwiedzi≈Ç bezpo≈õrednio konkretnƒÖ witrynƒô.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Witryny mogƒÖ zbieraƒá informacje o tobie, u≈ºywaƒá ciasteczek, do≈ÇƒÖczaƒá dodatkowe, zewnƒôtrzne systemy ≈õledzenia i monitorowaƒá twoje interakcje z osadzonym materia≈Çem, w≈ÇƒÖczajƒÖc w to ≈õledzenie twoich interakcji z osadzonym materia≈Çem je≈õli posiadasz konto i jeste≈õ zalogowany w tamtej witrynie.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Analiza statystyk</h3><!-- /wp:heading --><!-- wp:heading --><h2>Z kim dzielimy siƒô danymi</h2><!-- /wp:heading --><!-- wp:heading --><h2>Jak d≈Çugo przechowujemy twoje dane</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Je≈õli zostawisz komentarz, jego tre≈õƒá i metadane bƒôdƒÖ przechowywane przez czas nieokre≈õlony. Dziƒôki temu jeste≈õmy w stanie rozpoznawaƒá i zatwierdzaƒá kolejne komentarze automatycznie, bez wysy≈Çania ich do ka≈ºdorazowej moderacji.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Dla u≈ºytkownik√≥w kt√≥rzy zarejestrowali siƒô na naszej stronie internetowej (je≈õli tacy sƒÖ), przechowujemy r√≥wnie≈º informacje osobiste wprowadzone w profilu. Ka≈ºdy u≈ºytkownik mo≈ºe dokonaƒá wglƒÖdu, korekty albo skasowaƒá swoje informacje osobiste w dowolnej chwili (nie liczƒÖc nazwy u≈ºytkownika, kt√≥rej nie mo≈ºna zmieniƒá). Administratorzy strony r√≥wnie≈º mogƒÖ przeglƒÖdaƒá i modyfikowaƒá te informacje.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Jakie masz prawa do swoich danych</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Je≈õli masz konto u≈ºytkownika albo doda≈Çe≈õ komentarze w tej witrynie, mo≈ºesz za≈ºƒÖdaƒá dostarczenia pliku z wyeksportowanym kompletem twoich danych osobistych bƒôdƒÖcych w naszym posiadaniu, w tym ca≈Ço≈õƒá tych dostarczonych przez ciebie. Mo≈ºesz r√≥wnie≈º za≈ºƒÖdaƒá usuniƒôcia przez nas ca≈Ço≈õci twoich danych osobistych w naszym posiadaniu. Nie dotyczy to ≈ºadnych danych kt√≥re jeste≈õmy zobligowani zachowaƒá ze wzglƒôd√≥w administracyjnych, prawnych albo bezpiecze≈Ñstwa.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Gdzie przesy≈Çamy dane</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Komentarze go≈õci mogƒÖ byƒá sprawdzane za pomocƒÖ automatycznej us≈Çugi wykrywania spamu.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Twoje dane kontaktowe</h2><!-- /wp:heading --><!-- wp:heading --><h2>Informacje dodatkowe</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Jak chronimy twoje dane?</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Jakie mamy obowiƒÖzujƒÖce procedury w przypadku naruszenia prywatno≈õci danych</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Od jakich stron trzecich otrzymujemy dane</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Jakie automatyczne podejmowanie decyzji i/lub tworzenie profili przeprowadzamy z u≈ºyciem danych u≈ºytkownika</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Bran≈ºowe wymogi regulacyjne dotyczƒÖce ujawniania informacji</h3><!-- /wp:heading -->', 'Polityka prywatno≈õci', '', 'trash', 'closed', 'open', '', 'polityka-prywatnosci__trashed', '', '', '2020-01-20 12:19:07', '2020-01-20 11:19:07', '', 0, 'http://localhost/burgers_workon_project/?page_id=3', 0, 'page', '', 0),
