 komentarz, jego tre≈õƒá i metadane bƒôdƒÖ przechowywane przez czas nieokre≈õlony. Dziƒôki temu jeste≈õmy w stanie rozpoznawaƒá i zatwierdzaƒá kolejne komentarze automatycznie, bez wysy≈Çania ich do ka≈ºdorazowej moderacji.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Dla u≈ºytkownik√≥w kt√≥rzy zarejestrowali siƒô na naszej stronie internetowej (je≈õli tacy sƒÖ), przechowujemy r√≥wnie≈º informacje osobiste wprowadzone w profilu. Ka≈ºdy u≈ºytkownik mo≈ºe dokonaƒá wglƒÖdu, korekty albo skasowaƒá swoje informacje osobiste w dowolnej chwili (nie liczƒÖc nazwy u≈ºytkownika, kt√≥rej nie mo≈ºna zmieniƒá). Administratorzy strony r√≥wnie≈º mogƒÖ przeglƒÖdaƒá i modyfikowaƒá te informacje.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Jakie masz prawa do swoich danych</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Je≈õli masz konto u≈ºytkownika albo doda≈Çe≈õ komentarze w tej witrynie, mo≈ºesz za≈ºƒÖdaƒá dostarczenia pliku z wyeksportowanym kompletem twoich danych osobistych bƒôdƒÖcych w naszym posiadaniu, w tym ca≈Ço≈õƒá tych dostarczonych przez ciebie. Mo≈ºesz r√≥wnie≈º za≈ºƒÖdaƒá usuniƒôcia przez nas ca≈Ço≈õci twoich danych osobistych w naszym posiadaniu. Nie dotyczy to ≈ºadnych danych kt√≥re jeste≈õmy zobligowani zachowaƒá ze wzglƒôd√≥w administracyjnych, prawnych albo bezpiecze≈Ñstwa.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Gdzie przesy≈Çamy dane</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Komentarze go≈õci mogƒÖ byƒá sprawdzane za pomocƒÖ automatycznej us≈Çugi wykrywania spamu.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Twoje dane kontaktowe</h2><!-- /wp:heading --><!-- wp:heading --><h2>Informacje dodatkowe</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Jak chronimy twoje dane?</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Jakie mamy obowiƒÖzujƒÖce procedury w przypadku naruszenia prywatno≈õci danych</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Od jakich stron trzecich otrzymujemy dane</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Jakie automatyczne podejmowanie decyzji i/lub tworzenie profili przeprowadzamy z u≈ºyciem danych u≈ºytkownika</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Bran≈ºowe wymogi regulacyjne dotyczƒÖce ujawniania informacji</h3><!-- /wp:heading -->', 'Polityka prywatno≈õci', '', 'inherit', 'closed', 'closed', '', '3-revision-v1', '', '', '2020-01-20 12:19:07', '2020-01-20 11:19:07', '', 3, 'http://localhost/burgers_workon_project/3-revision-v1/', 0, 'revision', '', 0),
