(145, 1, '2020-01-29 18:07:53', '2020-01-29 17:07:53', 'Je≈õli mam ochotƒô zje≈õƒá co≈õ ze znajomymi, zawsze wybieram Burgeromaniƒô. Nie wiem jak oni to robiƒÖ, ale podajƒÖ najlepsze burgery w mie≈õcie w bardzo atrakcyjnej cenie. A kiedy nie chce mi siƒô wychodziƒá z domu, po prostu zamawiam jedzenie na ich stronie.', 'Opinia 1', '', 'publish', 'closed', 'closed', '', 'opinia-1', '', '', '2020-01-29 18:07:53', '2020-01-29 17:07:53', '', 0, 'http://localhost/burgers_workon_project/?post_type=reviews&#038;p=145', 0, 'reviews', '', 0),
